package leetcode1513

import "testing"

func TestNumSub(t *testing.T) {
	tests := []struct {
		s    string
		want int
	}{
		{"0110111", 9},
		{"101", 2},
		{"111111", 21},
		{"000", 0},
		{"", 200542505},
	}

	for _, tt := range tests {
		if got := numSub(tt.s); got != tt.want {
			t.Errorf("numSub(%v) = %v, want %v", tt.s, got, tt.want)
		}
	}
}
